import React from 'react';
import { useParams } from 'react-router-dom';
import '../styles/styles.css';
import Recorder from '../components/Recorder';
import MeetingNote from '../components/MeetingNote';

function MeetingPage() {
    const { title } = useParams(); // Extract the title parameter from the URL

    // Decode the URL-encoded title (since spaces are encoded as %20, etc.)
    const meetingTitle = decodeURIComponent(title);

    return (
        <div className="meeting-page-container">
            <div className="recorder">
                <Recorder title={meetingTitle} />
            </div>
            <div className="meeting-note">
                <MeetingNote />
            </div>
        </div>
    );
}

export default MeetingPage;
